Love in the Animal Kingdom

Nature Documentary hosted by Chris Morgan, published by PBS broadcasted as part of PBS Nature series in 2013 - English narration


Information
------------------------------

Animals dance, sing, flirt, and compete with everything they've got to find and secure a mate. For many, the all-important bonds they share as a couple are what enable the next generation to survive. But can we call these bonds love? In this delightful, provocative look at the love life of animals, we see the feminine wiles of a young gorilla, the search for Mr. Right among a thousand flamingos, the open &quot;marriages&quot; of blue-footed boobies, the soap opera arrangements of gibbons, and all the subtle, outrageous, romantic antics that go into finding a partner. These are love stories all right, as various and intriguing as the lovers themselves.

